import { useEffect, useState } from "react";
import jwt_decode from 'jwt-decode';

export default function Homepage() {

    const [userGoogle, setUserGoogle ]= useState({});
    console.log(userGoogle);

    useEffect(() => {
        const token = localStorage.getItem('userGoogle');
        if (token) {
          const decoded = jwt_decode(token);
          setUserGoogle(decoded);
        }
      }, [setUserGoogle]);

    return (
      <div className="container">
        <div className="row">
          <h1> Homepage </h1>
        </div>
        <div className="row">
          <div className="col-6 ">
            <h2>Bienvenue {userGoogle.name}</h2>
          </div>
          <div className="col-6">
            <img src={`${userGoogle.picture}`}></img>
          </div>
        </div>
        <div className="row">
          <p>Vous êtes connecté avec votre Compte Google</p>
        </div>
      </div>
    );
}
